import React, { useEffect } from 'react';
import axios from 'axios';

function Exchange() {

    useEffect(() => {
        axios.get("https://api.exchangeratesapi.io/latest").then(res => {
            console.log(res.data);
        })

    });



    return (
        <div><h3>Test</h3></div>
    );
}


export default Exchange;
